  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains Official Protraction
  Diagram (OPD) outlines in ESRI Arc/Info export and Arc/View shape file formats for
  the BOEM Pacific Region. The use of OPD s makes it easier to refer to individual
  blocks within a region or planning area. Further information on the historic development
  of OPD s can be found in OCS Report BOEM 99-0006: Boundary Development on the Outer
  Continental Shelf. These OPD diagrams were clipped along the Submerged Lands Act
  (SLA) boundary and along lines contained in the Continental Shelf Boundaries (CSB)
  GIS data files to show only those blocks or portions thereof within federal jurisdiction.
  Because GIS projection and topology functions can change or generalize coordinates,
  these GIS files are NOT an OFFICIAL record for the exact OPD boundaries. Only the
  paper OPD or a digital image of them serve as OFFICIAL records. PDF versions available
  for printing can be found here: http://www.boem.gov/Oil-and-Gas-Energy-Program/Mapping-and-Data/Pacific.aspx\",\n\t\"owner_org\":
